import React  from "react";
import { Link } from "react-router-dom";

function Header() {
    return (
        <header>
            <h1>My Awesome App</h1>
            <h2>Navigation</h2>
            <nav>
                <ul>
                    <li>
                        <Link to="/">Home</Link>
                    </li>
                    <li>
                        <Link to="/about">About</Link>
                    </li>
                    <li>
                        <Link to="/contact">Contact</Link>
                    </li>
                </ul>
            </nav>
        </header>
    );
}

export default Header;
